import '@fortawesome/fontawesome-free/css/all.min.css';
import React, { useState, useEffect } from 'react';
import SideBar from './sideBar';
import { Link, Router, Routes, BrowserRouter } from 'react-router-dom';

const NavBar = () => {

    const [isSidebarOpen, setIsSidebarOpen] = useState(false);

    const toggleSidebar = () => {
        setIsSidebarOpen(!isSidebarOpen);
    };

    return (
        <div className="navbar">
            <h1 className="company">NEEMAN'S</h1>
            <div className="midHeadings">
                        <Link to="/derbies">NEW</Link>
                        <Link to="/movers">MEN</Link>
                        <Link to="/slipon">WOMEN</Link>
                        <Link to="/offers">OFFERS</Link>
                        <Link to="/about-us">ABOUT US</Link>
            </div>

            <div className="cornerHeadings">
                <i className="fas fa-search"></i> Search
                <i className="fas fa-store"></i> FIND STORES
                <a onClick={toggleSidebar} className="cart-btn"> <i className="fas fa-shopping-cart"></i>CART</a>
            </div>
            <SideBar isSidebarOpen={isSidebarOpen} toggleSidebar={toggleSidebar} />
        </div>

    );
}

export default NavBar;
